description:
Blue Hour Tequila - Blanco - Pure Spirit™

Unkissed by the barrel, our award winning Blanco represents the freshest and purest essence of the Blue Agave. Like a fine Beaujolais Nouveau, it expresses the youthful vitality from the Blue Agave directly into each bottle. Our Master Alquimia skillfully create Blanco from a variety of unrested highland blends. Poured into the bottle immediately after its creation, Blanco’s freshness emanates throughout and shines forth upon opening.

